arStrings.szText:
{c_label}秒間攻撃回数: {c_number}{s1}{/c}{/c}
{icon:bullet} 武器の攻撃速度から算出した攻撃回数。
{icon:bullet} スキルやアイテムによって増加する。

{c_label}クリティカルヒット率: {c_number}{s1}{/c}{/c}
{icon:bullet} クリティカルヒットが{c_number}{s2}{/c}のダメージ・ボーナスを得る。
{icon:bullet} スキルやアイテムによって上昇する。

{c_label}盾のブロック量: {c_number}{s1}{/c}{/c}
{icon:bullet} 攻撃をブロックした際に減少するダメージの量。
{icon:bullet} 盾のブロック量はスキルやアイテムによって増加する。

{c_label}ライフ最大値: {c_number}{s2}{/c}{/c}
{icon:bullet} ライフが0になると死亡する。
{icon:bullet} ライフはスキル、アイテムによって増加する。

{c_label}敵を倒した際のライフ回復量: {c_number}{s1}{/c}{/c}
{icon:bullet} 敵を1体倒すごとにライフが{c_number}{s2}{/c}回復する。
{icon:bullet} 回復量はスキルやアイテムによって増加する。

{c_label}攻撃命中ごとのライフ回復量: {c_number}{s1}{/c}{/c}
{icon:bullet} 攻撃が命中するごとにライフが{c_number}{s2}{/c}回復する。
{icon:bullet} 回復量はスキルやアイテムによって増加する。

{c_label}クリティカルヒットダメージボーナス: {/c}{c_number}{s1}{/c}
{icon:bullet} スキルやアイテムによって増加する。
{icon:bullet} ほかのプレイヤーに対しての上限は{c_number}{s2}{/c}。

{c_label}移動速度:{/c} {c_number}{s1}{/c}
{icon:bullet} 基本移動速度の{c_number}{s2}{/c}で移動する。
{icon:bullet} アイテムの効果によって、移動速度は最大{c_number}+25.00%{/c}まで上昇する。

{c_label}経験値ボーナス: {c_number}{s1}{/c}{/c}
{icon:bullet} モンスターを倒した際に得られる経験値が{c_number}{s2}{/c}増加する。
{icon:bullet} 増加倍数: {c_number}{s3}x{/c}。マルチプレイ時に適用される。

{c_label}荊棘の加護:{/c} {c_number}{s1}{/c}
{icon:bullet} 直接攻撃をしてきた相手に対してダメージを跳ね返す。継続ダメージに対しては発動しない。
{icon:bullet} 与えるダメージ量には、主要能力値の一部も加算される。

{c_label}ライフ最大値: {c_number}{s2}{/c}{/c}
{icon:bullet} 従者のライフが0になると、その従者はしばらくの間戦闘不能になる。
{icon:bullet} ライフはスキル、アイテムによって増加する。

{c_label}ライフ最大値: {c_number}{s2}{/c}{/c}
{icon:bullet} 従者のライフが0になると、その従者はしばらくの間戦闘不能になる。
{icon:bullet} ライフはスキル、アイテムによって増加する。

{c_label}ライフ最大値: {c_number}{s2}{/c}{/c}
{icon:bullet} 従者のライフが0になると、その従者はしばらくの間戦闘不能になる。
{icon:bullet} ライフはスキル、アイテムによって増加する。

{c_label}範囲ダメージ:{/c} {c_number}{s1}{/c}
{icon:bullet} あらゆる攻撃が{c_number}{s2}{/c}の確率で、{c_number}{s4}{/c}ヤード以内の敵に{c_number}{s3}{/c}のダメージを与える。
{icon:bullet} ダメージ量はアイテムによって上昇する。

{c_label}{s1}ダメージ増加:{/c} {c_number}{s2}{/c}
{icon:bullet} この属性のスキルで与えるダメージが増加する。
{icon:bullet} {s3}ダメージ: {c_number}{s4}{/c}。

{c_label}意志力:{/c} {c_number}{s1}{/c} {c_lightgray}（アイテム貢献度: {c_blue}{s4}{/c}）{/c}{s2}
{icon:bullet} 回復量が{c_number}{s3}{/c}上昇する。
{icon:bullet} {c_important}{u}オーバーパワー{/u}{/c_important}ダメージが{c_number}{s5}{/c}}上昇する。

{c_label}キルごとのダメージ障壁: {c_number}{s1}{/c}{/c}
{icon:bullet} 敵を倒すとダメージ障壁を獲得する。
{icon:bullet} 吸収するダメージ量はアイテムにより増加する。

{c_label}ポーションクールダウン時間短縮: {c_number}{s1}{/c}{/c}
{icon:bullet} ポーションのクールダウン時間を短縮する。
{icon:bullet} アイテムでのさらなる短縮が可能。

{c_label}オーバーパワーの発生率:{/c} {c_number}{s1}{/c}
{icon:bullet} 現在のライフおよび追加ライフの合計値に基づき、オーバーパワーが与えるダメージにボーナスが付与される。
{icon:bullet} 継続ダメージ、パッシブ・アビリティ、連続発動アビリティはオーバーパワーにならない。
